import React, { Component } from 'react';
import './App.css';

class App extends Component {
  state = { playlists: [] };

  componentDidMount() {
    fetch('/playlists')
    .then(res => res.json())
    .then(playlists => this.setState({ playlists }));

  }

  render() {
    return (
      <div className="App">
       <h1>Playlists</h1>
       <ul>
          <li key={ this.state.playlists.href }>{ this.state.playlists.items[0].external_urls.name }</li>
       </ul>
      </div>
    );
  }
}

export default App;
